import React from 'react';
import './grid.css';

export default function Grid(props) {

    return (
        <div key={props.key} className="grid">
            <h2>Resultados de la b√∫squeda</h2>
            {props.setShowQuery ?(
                <div className="resultados">
                    {props.setShowQuery.map((gif=>{
                        return <img src={gif.emdeb_url} alt="Gifs"/>
                    }))}
                </div>
            ): ""}
        </div>
    )
}
